import copy

import numpy as np
from line_profiler_pycharm import profile


class Solution:
    @profile
    def longestAwesome(self, s: str) -> int:
        len_s = len(s)
        s_int = list(map(int, list(s)))
        dp = np.zeros((len_s + 1, 10), dtype=bool)
        bits_first_index = [None] * (2 ** 10)
        bits_last_index = [None] * (2 ** 10)
        for i in range(1, len_s + 1):
            s_child = s_int[i - 1]
            if i > 0:
                dp[i] = dp[i - 1]
            dp[i][s_child] = not dp[i][s_child]

        if np.count_nonzero(dp[-1]) <= 1:
            return len(s)
        for i in range(len_s + 1):
            bit = self.bits_to_int(dp[i].tolist())
            if bits_first_index[bit] is None:
                bits_first_index[bit] = i
            bits_last_index[bit] = i

        result = 0
        for i in range(len_s + 1):
            target_bits = dp[i]
            for compensate_bits in self.compensate_bits_list(target_bits):
                bits_int = self.bits_to_int(compensate_bits)
                index = bits_last_index[bits_int]
                if index is not None:
                    result = max(result, index - i)

        return result

    def bits_to_int(self, bits):
        return int(''.join(list(map(lambda b: str(int(b)), bits))), 2)

    def compensate_bits_list(self, bits):
        result = []
        for i in range(10):
            new_bit = copy.deepcopy(bits)
            new_bit[i] = not bits[i]
            result.append(new_bit)
        return result


print(Solution().longestAwesome(
    ''))

